"        Beyond the Basics",
"       </dt>",
"       <dd>",
"        <a href=\"UTD.htm?15/45/16083\">",
"         Patient information: Jaundice in newborn infants (Beyond the Basics)",
"        </a>",
"       </dd>",
"      </dl>",
"      <div id=\"tooltipper\">",
"      </div>",
"     </div>",
"    </div>",
"   </div>",
"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Glucose-6-phosphate dehydrogenase deficiency (The Basics)",
"    </div>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H62884514\">",
"      <span class=\"h1\">",
"       What is glucose-6-phosphate dehydrogenase deficiency?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Glucose-6-phosphate dehydrogenase deficiency, called &ldquo;G6PD deficiency&rdquo; for short, is a condition that involves the red blood cells. G6PD is a protein in the red blood cells that helps them work normally. People with G6PD deficiency have too little G6PD in their red blood cells.",
"     </p>",
"     <p>",
"      This is a problem because red blood cells with too little G6PD are more likely to be destroyed by the body. Doctors call it &ldquo;hemolysis&rdquo; when the body destroys red blood cells. This can lead to a condition called anemia, which is when the body has too few red blood cells.",
"     </p>",
"     <p>",
"      G6PD deficiency is a condition people are born with. It is caused by an abnormal gene. There are different types of G6PD deficiency.",
"     </p>",
"     <p>",
"      G6PD deficiency is more common in some groups of people than others. It is more common in African-Americans and in people whose families originally came from the Mediterranean area or the Middle East.",
"     </p>",
"     <p>",
"      In the most common type of G6PD deficiency, hemolysis doesn&rsquo;t happen all the time. Episodes of hemolysis happen only when they are triggered by something. Common triggers include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Certain infections",
"       </li>",
"       <li>",
"        Certain medicines, such as &ldquo;sulfa&rdquo; antibiotics and medicines to treat malaria",
"       </li>",
"       <li>",
"        Specific foods, such as fava beans",
"       </li>",
"       <li>",
"        Breathing in or touching certain chemicals, such as those in moth balls",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H62884529\">",
"      <span class=\"h1\">",
"       What are the symptoms of G6PD deficiency?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Symptoms depend on the type of G6PD deficiency you have. Most people have no symptoms until an episode of hemolysis is triggered by 1 of the things listed above. Then symptoms can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Jaundice, which is when your skin or the whites of your eyes turn yellow",
"       </li>",
"       <li>",
"        Pale skin, or paleness of the lips, tongue, or inside of the eyelid",
"       </li>",
"       <li>",
"        Dark-colored urine",
"       </li>",
"       <li>",
"        Back or belly pain",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Less common types of G6PD deficiency can cause other symptoms. For example, 1 type causes jaundice in newborn babies. Another causes symptoms of anemia, which include headaches and feeling tired or weak.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H62884544\">",
"      <span class=\"h1\">",
"       Is there a test for G6PD deficiency?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. To check for this condition, your doctor or nurse will order different blood tests.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H62884559\">",
"      <span class=\"h1\">",
"       How is G6PD deficiency treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Treatment depends on your symptoms and how severe your anemia is. Most people do not need any treatment. That&rsquo;s because the symptoms will get better after the trigger goes away. This can take a few weeks.",
"     </p>",
"     <p>",
"      If your symptoms are caused by a medicine you take or a food you eat, your doctor will have you stop taking that medicine or eating that food.",
"     </p>",
"     <p>",
"      People with severe anemia are sometimes treated with a blood transfusion. This involves getting blood that has been donated by someone else. The donated blood goes into your vein through a thin tube called an &ldquo;IV.&rdquo;",
"     </p>",
"     <p>",
"      Babies with jaundice are often treated with &ldquo;light therapy.&rdquo; During light therapy, a doctor or nurse puts a baby under a special blue light or wraps a &ldquo;light blanket&rdquo; around him or her (",
"      <a class=\"graphic graphic_picture graphicRef55964 \" href=\"UTD.htm?2/49/2833\">",
"       picture 1",
"      </a>",
"      and",
"      <a class=\"graphic graphic_picture graphicRef73723 \" href=\"UTD.htm?1/23/1394\">",
"       picture 2",
"      </a>",
"      ).",
"     </p>",
"     <p>",
"      People with long-term anemia might be treated with a vitamin called",
"      <a class=\"drug drug_patient\" href=\"UTD.htm?24/57/25492?source=see_link\">",
"       folic acid",
"      </a>",
"      .",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H62884609\">",
"      <span class=\"h1\">",
"       Is there anything I can do on my own to prevent symptoms?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. You can avoid the foods, medicines, and chemicals that commonly trigger symptoms. If you are unsure about what to avoid, ask your doctor or nurse. You can also find a list of medicines that people with G6PD deficiency usually need to avoid on the Web site",
"      <a class=\"external\" href=\"file://www.g6pd.org/\">",
"       www.g6pd.org",
"      </a>",
"      .",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H62884624\">",
"      <span class=\"h1\">",
"       What if I want to get pregnant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you want to get pregnant, talk with your doctor or nurse before you start trying. If you or your partner has G6PD deficiency, there is a chance you will pass the gene that causes the condition to your baby. You might want to talk with a genetic counselor, a person who specializes in genetic conditions.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H62884639\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?5/26/5537?source=see_link\">",
"       Patient information: Complete blood count (CBC) (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?21/62/22498?source=see_link\">",
"       Patient information: Jaundice in babies (The Basics)",
"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?15/45/16083?source=see_link\">",
"       Patient information: Jaundice in newborn infants (Beyond the Basics)",
"      </a>",
"     </p>",
"    </div>",
