var script_f12_41_12955=[""].join("\n");
var outline_f12_41_12955=null;
var title_f12_41_12956="CT grading acute pancreatitis";
var content_f12_41_12956=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F68191&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F68191&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    CT findings and grading of acute pancreatitis (CT severity index [CTSI])",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\" colspan=\"3\" rowspan=\"1\">",
"        Grading based upon findings on unenhanced CT",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        Grade",
"       </td>",
"       <td class=\"subtitle2\">",
"        Findings",
"       </td>",
"       <td class=\"subtitle2\">",
"        Score",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        A",
"       </td>",
"       <td>",
"        Normal pancreas - normal size, sharply defined, smooth",
"contour, homogeneous enhancement, retroperitoneal peripancreatic fat",
"without enhancement",
"       </td>",
"       <td>",
"        0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        B",
"       </td>",
"       <td>",
"        Focal or diffuse enlargement of the pancreas, contour may",
"show irregularity, enhancement may be inhomogeneous but there is on",
"peripancreatic inflammation",
"       </td>",
"       <td>",
"        1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        C",
"       </td>",
"       <td>",
"        Peripancreatic inflammation with intrinsic pancreatic abnormalities",
"       </td>",
"       <td>",
"        2",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        D",
"       </td>",
"       <td>",
"        Intrapancreatic or extrapancreatic fluid collections",
"       </td>",
"       <td>",
"        3",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        E",
"       </td>",
"       <td>",
"        Two or more large collections of gas in the pancreas or retroperitoneum",
"       </td>",
"       <td>",
"        4",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1\" colspan=\"3\" rowspan=\"1\">",
"        Necrosis score based upon contrast enhanced CT",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\" colspan=\"2\" rowspan=\"1\">",
"        Necrosis, percent",
"       </td>",
"       <td class=\"subtitle2\">",
"        Score",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\" rowspan=\"1\">",
"        0",
"       </td>",
"       <td>",
"        0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\" rowspan=\"1\">",
"        &lt;33",
"       </td>",
"       <td>",
"        2",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\" rowspan=\"1\">",
"        33-50",
"       </td>",
"       <td>",
"        4",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\" rowspan=\"1\">",
"        &ge;50",
"       </td>",
"       <td>",
"        6",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     CT severity index equals unenhanced CT score plus necrosis score: maximum = 10, &ge;6 = severe disease.",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from Balthazar, EJ, Robinson, DL, Megibow, AJ, Ranson, JH, Radiology 1990; 174:331.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
