var title_f12_41_12958="Ca-PTH dynamics lithium";
var content_f12_41_12958=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ENDO%2F66597&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ENDO%2F66597&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 475px\">",
"   <div class=\"ttl\">",
"    Mean (&plusmn;SD) calcium-PTH dynamics in normal subjects and patients receiving lithium carbonate",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 455px; height: 335px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The curves were generated by measurements of serum PTH 30 minutes after serum ionized calcium concentrations had been raised or lowered by administration of calcium or citrate, respectively. The serum calcium-PTH curve is shifted to the right in the lithium-treated patients, and the set point is 5.10 mg/dL (1.28 mmol/L), as compared with 4.86 mg/dL (1.22 mmol/L) in the normal subjects.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Haden ST, Stoll AL, McCormick S, et al. Alterations in parathyroid dynamics in lithium-treated subjects.&nbsp;J Clin Endocrinol Metab 1997; 82:2844",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
